
import java.util.HashMap;
import java.util.Map;

/*
 * Given two strings s and t , write a function to determine if t is an anagram of s.

Example 1:

Input: s = "anagram", t = "nagaram"
Output: true
Example 2:

Input: s = "rat", t = "car"
Output: false
Note:
You may assume the string contains only lowercase alphabets.

Follow up:
What if the inputs contain unicode characters? How would you adapt your solution to such case?
 */

/**
 *
 * @author Portatil
 */
public class Solution {

    /**
     * @param args the command line arguments
     */
    public static void main(String[] args) {
        String s = "";
    
        String t = "";
    
        System.out.println("Anagram?: "+isAnagram(s,t));
        
    }
    
      public static boolean isAnagram(String s, String t) {
        
        int[] res = new int[26];
        
        for(char c: s.toCharArray()){
            res[c - 'a']++;
        }
        
        for(char c: t.toCharArray()){
            res[c - 'a']--;
        }
        
        for(int i: res){
            if(i != 0){
                return false;
            }
        }
        return true;
    }
      
      public static boolean isAnagramOriginal(String s, String t) {
        
        boolean result=true;
        
        if(s.length()==t.length())
        {
            
            HashMap<Character,Integer> sMap= new HashMap(s.length());
            
            HashMap<Character,Integer> tMap= new HashMap(t.length());
            
            for(int i=0;i<s.length();i++)
            {
                
                if(sMap.containsKey(s.charAt(i)))
                {
                    int temp=sMap.get(s.charAt(i));
                    temp++;
                    sMap.put(s.charAt(i),temp);
                }
                else
                {
                    sMap.put(s.charAt(i),1);
                }
                
            }
            
            for(int i=0;i<t.length();i++)
            {
                
                if(tMap.containsKey(t.charAt(i)))
                {
                    int temp=tMap.get(t.charAt(i));
                    temp++;
                    tMap.put(t.charAt(i),temp);
                }
                else
                {
                    tMap.put(t.charAt(i),1);
                }
                
            }
            
            
            for(Map.Entry<Character,Integer> entry : sMap.entrySet())
            {
                Character sKey = entry.getKey();
                
                Integer sValue = entry.getValue();
                
                //System.out.println(sKey+": "+sValue);
                
                //System.out.println(sKey+": "+tMap.get(sKey));
                
                if(!tMap.containsKey(sKey) || !tMap.get(sKey).equals(sValue))
                {
                    return false;
                }
                
            }
            
            
        }
        else
            result=false;
        
        return result;
    }
    
}
